import React, { useState } from "react";
import logo from "../../assets/logo1.png";

const UserLogsChart = ({ theme }) => {
  const [logs, setLogs] = useState([
    // (Your existing logs array)
  ]);

  const themeColors =
    theme === "night"
      ? {
          bgColor: "#1F2937",
          textColor: "#E5E7EB",
          borderColor: "#374151",
        }
      : {
          bgColor: "#FFFFFF",
          textColor: "#1F2937",
          borderColor: "#D1D5DB",
        };

  return (
    <div
      className="user-logs-container"
      style={{
        padding: "20px",
        backgroundColor: themeColors.bgColor,
        color: themeColors.textColor,
        borderRadius: "10px",
        maxWidth: "900px",
        margin: "0 auto",
      }}
    >
      {/* Logo and Title Section */}
      <div
        className="header"
        style={{
          display: "flex",
          alignItems: "center",
          marginBottom: "10px",
        }}
      >
        <img
          src={logo}
          alt="Logo"
          style={{ height: "50px", marginRight: "15px" }}
        />
        <h1
          style={{
            fontWeight: "bold",
            fontSize: "1.8rem",
            margin: 0,
            color: themeColors.textColor,
          }}
        >
          Pugad Maharlika
        </h1>
      </div>

      {/* Placeholder for Name and Date */}
      <div
        className="holder-section"
        style={{
          display: "flex",
          justifyContent: "flex-start",
          marginBottom: "20px",
        }}
      >
        <div style={{ marginRight: "20px" }}>
          <strong>Name:</strong> {/* Placeholder value */}
        </div>
        <div>
          <strong>Date:</strong> {/* Placeholder value */}
        </div>
      </div>

      <h2 style={{ textAlign: "center", fontWeight: "bold" }}>User Logs</h2>

      <table
        style={{
          width: "100%",
          borderCollapse: "collapse",
          marginTop: "20px",
          color: themeColors.textColor,
        }}
      >
        {/* (Your existing table code) */}
      </table>
    </div>
  );
};

export default UserLogsChart;
